function App() {
  return (
    <div>
  <BrowserRouter>
    <Routes>
      {/* {
        routes.map(route => (
          <Route exact path={route.path} key={route.path}>
            {route.component}
          </Route>
        ))
      } */}
      <Route path='*' element={NotFound}/>
    </Routes>
  </BrowserRouter>
    </div>
  );
}

export default App;
